if (!function_exists('segment')){
    function segment($index): string{
        $REQUEST_URI = str_replace(BASE_URI, '', $_SERVER['REQUEST_URI']);
        $uri_segments = explode("/",$REQUEST_URI);
        return $uri_segments[$index];
    }
}

if (!function_exists("rando")) {

    function rando($length = 14): string{
        $str = "";
        $characters = array_merge(range('A','Z'), range('a','z'), range('0','9'));
        $max = count($characters) - 1;
        for ($i = 0; $i < $length; $i++) {
            $rand = mt_rand(0, $max);
            $str .= $characters[$rand];
        }

        return $str;
    }
}


