if(!function_exists('time_elapsed_string')){

    function time_elapsed_string($datetime, $full = false): string {
        $now = new DateTime;
        $ago = new DateTime($datetime);
        $diff = $now->diff($ago);

        $diff->w = floor($diff->d / 7);
        $diff->d -= $diff->w * 7;

        $string = [
            'y' => 'year',
            'm' => 'month',
            'w' => 'week',
            'd' => 'day',
            'h' => 'hour',
            'i' => 'minute',
            's' => 'second',
        ];
        foreach ($string as $k => &$v) {
            if ($diff->$k) {
                $v = $diff->$k . ' ' . $v . ($diff->$k > 1 ? 's' : '');
            } else {
                unset($string[$k]);
            }
        }

        if (!$full) {
            $string = array_slice($string, 0, 1);
        }

        return $string !== [] ? implode(', ', $string) . ' ago' : 'just now';
    }

}

if(!function_exists('timeDifferenceForNotification')){

    function timeDifferenceForNotification($timeDifference) {
        if ($timeDifference->days > 0){
            return (($timeDifference->days).' days ago');
        }else{
            return $timeDifference->format('%h hours and %i minutes ago');
        }

    }

}

if(!function_exists('markAsRead')){

    function markAsRead($id, $module): bool {

        switch ($module) {
            case 'project':
                $checkReadBy = explode(',', (string) Project::where('GeneratedKey', $id)->value('read_by'));
                if (!in_array(auth()->user()->id, $checkReadBy)) {
                    $checkReadBy[] = auth()->user()->id;
                    $checkReadBy = Project::where('GeneratedKey', $id)->update(['read_by' => implode(',', $checkReadBy)]);
                }

                break;

            case 'quote':
                $checkReadBy = explode(',', (string) Quotation::where('id', $id)->value('status_read_by'));
                if (!in_array(auth()->user()->id, $checkReadBy)) {
                    $checkReadBy[] = auth()->user()->id;
                    $checkReadBy = Quotation::where('id', $id)->update(['status_read_by' => implode(',', $checkReadBy)]);
                }

                $checkReadBy = explode(',', (string) Quotation::where('id', $id)->value('read_by'));
                if (!in_array(auth()->user()->id, $checkReadBy)) {
                    $checkReadBy[] = auth()->user()->id;
                    $checkReadBy = Quotation::where('id', $id)->update(['read_by' => implode(',', $checkReadBy)]);
                }

                break;
            case 'contractor':
                $checkReadBy = explode(',', (string) Customer::where('id', $id)->value('read_by'));
                if (!in_array(auth()->user()->id, $checkReadBy)) {
                    $checkReadBy[] = auth()->user()->id;
                    $checkReadBy = Customer::where('id', $id)->update(['read_by' => implode(',', $checkReadBy)]);
                }

                break;
            case 'user':
                $checkReadBy = explode(',', (string) User::where('id', $id)->value('read_by'));
                if (!in_array(auth()->user()->id, $checkReadBy)) {
                    $checkReadBy[] = auth()->user()->id;
                    $checkReadBy = User::where('id', $id)->update(['read_by' => implode(',', $checkReadBy)]);
                }

                break;

            case 'teamBoardMsg':
                $getUnreadMsgIds = TeamBoard::where('team_boards.ProjectId',$id)->whereRaw("((SELECT COUNT(id) FROM notification_read nr WHERE nr.type='team_board_msg' AND nr.typeId=team_boards.id AND nr.UserId='".auth()->user()->id."')=0)")->pluck('team_boards.id')->toArray();
                foreach ($getUnreadMsgIds as $msgId) {
                    DB::table('notification_read')->insert([
                        'UserId'=> auth()->user()->id,
                        'type'=> 'team_board_msg',
                        'typeId'=> $msgId
                    ]);
                }

                break;

            default:

                break;
        }

        return true;
    }

}

if(!function_exists('myCreatedUser')){


    function myCreatedUser() {
        $uType = auth()->user()->UserType;
        $userIds = [];
        switch ($uType) {
            case '2':
                $checkMyParent = DB::table('user_data')->where(['type'=> 'parent', 'user_id'=> auth()->user()->id])->value('value');
                $prntId = $checkMyParent ?: auth()->user()->id;

                $myCreatedAdmin = DB::table('user_data')->where(['type'=> 'parent', 'value'=> $prntId])->pluck('user_id')->toArray();
                $myCreatedAdmin[] = intval($prntId);

                $userIds = User::whereIn('CreatedBy', $myCreatedAdmin)->where('UserType',3)->pluck('id')->toArray();

                $userIds = array_merge($userIds, $myCreatedAdmin);

                break;
            case '3':
                $checkMyParent = DB::table('user_data')->where(['type'=> 'parent', 'user_id'=> auth()->user()->CreatedBy])->value('value');
                $prntId = $checkMyParent ?: auth()->user()->CreatedBy;

                $myParentCreatedAdmin = DB::table('user_data')->where(['type'=> 'parent', 'value'=> $prntId])->pluck('user_id')->toArray();
                $myParentCreatedAdmin[] = intval($prntId);

                $userIds = User::whereIn('CreatedBy', $myParentCreatedAdmin)->where('UserType',3)->pluck('id')->toArray();

                $userIds = array_merge($userIds, $myParentCreatedAdmin);

                break;

            default:

                break;
            }


        return $userIds;
    }

}


    function Lipping($insertedIn,$quotationId,$version,$doortype,$margin,$labourCostPH,$labourMargin,$minutes,$given_qty,$lipping_width1,$lipping_width2,$lipping_height,$cost_of_lipping,$lipping_thickness,$tag): ?string{
        $name               = 'Lipping';
        $insertedIn         = $insertedIn;
        $margin             = $margin;
        $labourCostPH       = $labourCostPH;
        $labourMargin       = $labourMargin;
        $minutes            = $minutes;
        $given_qty          = $given_qty;
        $lipping_width1     = $lipping_width1;
        $lipping_width2     = $lipping_width2;
        $lipping_height     = $lipping_height;
        $cost_of_lipping    = $cost_of_lipping;
        $lipping_thickness  = $lipping_thickness;
        $tag                = $tag;

        $LippingThicknessAdditional = 2;

        $qty = $given_qty*2;
        if (!empty($lipping_width1)) {
            $ConfigurableDoorFormula = ConfigurableDoorFormula::where('slug',"core_width_1")->first();
            if($ConfigurableDoorFormula !== null){
                $ConfigurableDoorFormulaDecoded = json_decode((string) $ConfigurableDoorFormula->value,true);
                $LippingThicknessAdditional = $ConfigurableDoorFormulaDecoded["lipping_thickness"];
            }

            $lipwidth1 = $lipping_width1 - $LippingThicknessAdditional * $lipping_thickness;
            $unit = $qty*$lipwidth1/1000;
            $mainValue =  $lipwidth1;
        } elseif (!empty($lipping_width2)) {
            $ConfigurableDoorFormula = ConfigurableDoorFormula::where('slug',"core_width_2")->first();
            if($ConfigurableDoorFormula !== null){
                $ConfigurableDoorFormulaDecoded = json_decode((string) $ConfigurableDoorFormula->value,true);
                $LippingThicknessAdditional = $ConfigurableDoorFormulaDecoded["lipping_thickness"];
            }

            $lipwidth2 = $lipping_width2 - $LippingThicknessAdditional * $lipping_thickness;
            $unit = $qty*$lipwidth2/1000;
            $mainValue =  $lipwidth2;
        } elseif (!empty($lipping_height)) {
            $ConfigurableDoorFormula = ConfigurableDoorFormula::where('slug',"core_height")->first();
            if($ConfigurableDoorFormula !== null){
                $ConfigurableDoorFormulaDecoded = json_decode((string) $ConfigurableDoorFormula->value,true);
                $LippingThicknessAdditional = $ConfigurableDoorFormulaDecoded["lipping_thickness"];
            }

            $lipping_height -= $LippingThicknessAdditional * $lipping_thickness;
            $unit = $qty*$lipping_height/1000;
            $mainValue =  $lipping_height;
        } else {
            return 'error';
        }

        $unitCost = $cost_of_lipping;
        $GrandTotalCost = round($unit*$unitCost,2);
        $markup = round($margin/100*$GrandTotalCost,2);
        $TotalPrice = round($markup + $GrandTotalCost,2);
        $processCost = $labourCostPH/60*$minutes;
        $labourMarkup = round($labourMargin/100*$processCost,2);
        $labourTotal = $labourMarkup + $processCost;
        $grandTotal = round($labourTotal + $TotalPrice,2);

        $type = 'Door Leaf Items';
        $total_slabs_per_type = null;
        InsertBOMDetails($type,$name,$insertedIn,$mainValue,$quotationId,$version,$doortype,$qty,$unit,$total_slabs_per_type,$unitCost,$GrandTotalCost,$margin,$markup,$TotalPrice,$labourCostPH,$minutes,$processCost,$labourMargin,$labourMarkup,$labourTotal,$grandTotal,$tag);
        return null;
    }


    function DoorCore($quotationId,$version,$doortype,$SelectedDoorDimension,$margin,$labourCostPH,$labourMargin,$given_qty,$door,$unitCost,$cutting_door_core,$tag): void{
        $name = 'DoorCore';
