        $door                   = $door;
        $unitCost               = $unitCost;
        $cutting_door_core      = $cutting_door_core;
        $tag                    = $tag;


        $qty                    = $given_qty;
        if ($door == 'SD') {
            // Double Door
            $unit = 1;
        } elseif ($door == 'DD' || $door == 'leaf_and_a_half') {
            // Leaf and Half  &&  Double Door
            $unit = $qty*2;
        }

        $total_slabs_per_type = $qty*$unit;
        $GrandTotalCost = $qty*$unit*$unitCost;
        $markup = round($margin/100*$GrandTotalCost,2);
        $TotalPrice = round($markup + $GrandTotalCost,2);
        $minutes = $cutting_door_core*$qty*$unit;
        $processCost = $labourCostPH/60*$minutes;
        $labourMarkup = round($labourMargin/100*$processCost,2);
        $labourTotal = $labourMarkup + $processCost;
        $grandTotal = round($labourTotal + $TotalPrice,2);

        $type = 'Door Leaf Items';
        $mainValue = null;
        InsertBOMDetails($type,$name,$insertedIn,$mainValue,$quotationId,$version,$doortype,$qty,$unit,$total_slabs_per_type,$unitCost,$GrandTotalCost,$margin,$markup,$TotalPrice,$labourCostPH,$minutes,$processCost,$labourMargin,$labourMarkup,$labourTotal,$grandTotal,$tag);
    }


    function DoorFinish($quotationId,$version,$doortype,$margin,$labourCostPH,$labourMargin,$totalSlabsPerType,$unitCost,$door_leaf_facing,$core_width1,$core_width2,$core_height,$pressing_door,$tag): void{
        $name = 'DoorFinish';
        $insertedIn = null;
        $margin                 = $margin;
        $labourCostPH           = $labourCostPH;
        $labourMargin           = $labourMargin;
        $totalSlabsPerType      = $totalSlabsPerType;
        $unitCost               = $unitCost;
        $door_leaf_facing       = $door_leaf_facing;
        $core_width1            = $core_width1;
        $core_width2            = $core_width2;
        $core_height            = $core_height;
        $pressing_door          = $pressing_door;
        $tag                    = $tag;


        $qty = $totalSlabsPerType*2;
        if ($door_leaf_facing == 'Laminate') {
            $unit = null;
            $total_slabs_per_type = null;
            $GrandTotalCost = round($qty*$unitCost,2);
        } elseif ($door_leaf_facing == 'Kraft_Paper' || $door_leaf_facing == 'Veneer') {
            $x1 = $core_width1/1000*$core_height/1000;
            $x2 = $core_width2/1000*$core_height/1000;
            $x3 = $x1 + $x2;
            $x4 = $x3/2;
            $unit = round($x4,5);
            $total_slabs_per_type = $qty*$unit;
            $GrandTotalCost = round($total_slabs_per_type*$unitCost,2);
        }

        $markup = round($margin/100*$GrandTotalCost,2);
        $TotalPrice = round($markup + $GrandTotalCost,2);
        $minutes = $pressing_door*$qty/2;
        $processCost = $labourCostPH/60*$minutes;
        $labourMarkup = round($labourMargin/100*$processCost,2);
        $labourTotal = $labourMarkup + $processCost;
        $grandTotal = round($labourTotal + $TotalPrice,2);


        $type = 'Door Leaf Items';
        $mainValue = null;
        InsertBOMDetails($type,$name,$insertedIn,$mainValue,$quotationId,$version,$doortype,$qty,$unit,$total_slabs_per_type,$unitCost,$GrandTotalCost,$margin,$markup,$TotalPrice,$labourCostPH,$minutes,$processCost,$labourMargin,$labourMarkup,$labourTotal,$grandTotal,$tag);
    }



