    function InsertBOMDetails($type,$name,$insertedIn,$mainValue,$quotationId,$version,$doortype,$qty,$unit,$total_slabs_per_type,$unitCost,$GrandTotalCost,$margin,$markup,$TotalPrice,$labourCostPH,$minutes,$processCost,$labourMargin,$labourMarkup,$labourTotal,$grandTotal,$tag): void{
