        $bom->process_cost          = $processCost;
        $bom->labour_margin         = $labourMargin;
        $bom->labour_markup         = $labourMarkup;
        $bom->labour_total          = $labourTotal;
        $bom->grand_total           = $grandTotal;
        $bom->tag                   = $tag;
        $bom->save();
    }




// Intumscent Seal
    function checkValid($h, $w, array $data): bool {
        $point1height = $data["Point1height"];  $point2height = $data["Point2height"];
        $point1width = $data["Point1width"];   $point2width = $data["Point2width"];
        if ($h >= $point1height && $h <= $point2height && $w >= $point2width && $w <= $point1width) {
            $y = ($point2height-$point1height)/($point1width-$point2width)*($w-$point2width)+$point1height;
            if ($h > $y) {
                return false;
            } else {
                return  true;
            }
        } elseif ($h > $point2height || $w > $point1width) {
            return false;
        } else {
            return true;
        }
    }

    function checkValidScreen($h, $w, array $data): bool {
        $point1height = $data["HeightPoint1"];  $point2height = $data["HeightPoint2"];
        $point1width = $data["WidthPoint1"];   $point2width = $data["WidthPoint2"];
        if ($h >= $point1height && $h <= $point2height && $w >= $point2width && $w <= $point1width) {
            $y = ($point2height-$point1height)/($point1width-$point2width)*($w-$point2width)+$point1height;
            if ($h > $y) {
                return false;
            } else {
                return  true;
            }
        } elseif ($h > $point2height || $w > $point1width) {
            return false;
        } else {
            return true;
        }
    }



