function CurrencyBeautify($cur=''): string{
    $currency = '';
    if ($cur == '£_GBP') {
        $currency = "£ GBP";
    } elseif ($cur == '€_EURO') {
        $currency = "€ EURO";
    } elseif ($cur == '$_US_DOLLAR') {
        $currency = "$ US DOLLAR";
    } else{
        $currency = "£ GBP";
    }

    return $currency;
}

function QuotationCurrency($cur=''): string{
    $currency = '';
    if ($cur == '£_GBP') {
        $currency = "£";
    } elseif ($cur == '€_EURO') {
        $currency = "€";
    } elseif ($cur == '$_US_DOLLAR') {
        $currency = "$";
    } else{
        $currency = "£";
    }

    return $currency;
}


