//when we add multiple doors to single door type then this function is called
function BOMQuatityOfDoorUpdate($itemid,$QuotationId): void{
    $ItemMaster = ItemMaster::where('itemID',$itemid)->get()->count();
    if(empty($ItemMaster)){
        $ItemMaster = 1;
    }

    $BOMCalculation = BOMCalculation::where('itemId',$itemid)->where('QuotationId',$QuotationId)->get();
    $Items = Item::where('itemId',$itemid)->where('QuotationId',$QuotationId)->get()->first();

    if(!empty($BOMCalculation)){
        foreach($BOMCalculation as $bom){
            if($ItemMaster == 1){
                $quantity = $bom->QuantityOfDoorTypes;
                $totalSum = $bom->TotalCost;
            }else{
                $quantity = ($bom->QuantityOfDoorTypes / ($ItemMaster - 1));
                $totalSum = ($bom->TotalCost / ($ItemMaster - 1));
            }

            $update = BOMCalculation::find($bom->id);
            $total = round(($totalSum * $ItemMaster),2);
            if ($bom->Category == 'Ironmongery&MachiningCosts' || $bom->Category == 'MachiningCosts'){
                $update->QuantityOfDoorTypes = $bom->QuantityOfDoorTypes;
                $update->LMPerDoorType = $bom->LMPerDoorType + $bom->QuantityOfDoorTypes;
                $update->TotalCost = ($bom->LMPerDoorType + $bom->QuantityOfDoorTypes) * $bom->UnitCost;
            }else{
                $update->QuantityOfDoorTypes = round(($quantity * $ItemMaster),2);
                $update->TotalCost = $total;
            }

            $update->GTSellPrice = round(($total /(1 - ($bom->Margin/100))),2);
            $update->save();
        }
    }
}

