                $LMOfGlazingSystem = $LMOfGlazing/1000;
                $unit_cost = $pricePerLM*$LMOfGlazingSystem;
            }else{
                $unit_cost = 0;
            }
        }else{
            $unit_cost = 0;
        }

        $margin = BOMSetting::wherein('UserId',$userIds)->value('margin_for_material');
        $word = str_replace('_', ' ',  $request->glazingBeads);
