                }

                $description = '[Sides]|'.$frameMaterial[0]['SpeciesName'].', '.$request->frameFinish.'|'.$request->frameDepth.'mm x '.$request->frameThickness.'mm x '. $request->frameHeight.'mm | - | -';
                $QtyPerDoorType = ($request->frameHeight/1000)*2;
