function getLippingSpeciesNearTheeknessValue($val){
    if(empty($val)){
        return "0";
    }

    $Thickness = round($val/25.4,1);
    $parts = explode('.', (string) $Thickness);
    if(!isset($parts[1])){
        return $parts[0];
    }


    if($parts[1] == 0){
        $Thickness = $parts[0];
    }elseif($parts[1] > 0 && $parts[1] < 5){
        $Thickness = $parts[0]."."."5";
    }elseif($parts[1] == 5){
        $Thickness = $Thickness;
    }elseif($parts[1] > 5){
        $Thickness = $parts[0] + 1;
    }

    return $Thickness;

}

