function doorcorename($doorCore): string{
    $doorCoreValue = match ($doorCore) {
        1 => 'streboard',
        2 => 'halspan',
        3 => 'norma',
        4 => 'vicaima',
        5 => 'seadec',
        6 => 'Deanta',
        7 => 'Flamebreak',
        8 => 'Stredor',
        default => $doorCoreValue,
    };

    return $doorCoreValue;
}

