function lippingSpeciesName($id){
    $Species = LippingSpecies::where('id',$id)->where('Status',1)->first();
    $Species = empty($Species) ? $id : $Species->SpeciesName;

    return $Species;
}

function lippingSpeciesId($name){
    $Species = LippingSpecies::where('SpeciesName',$name)->where('Status',1)->first();
    $SpeciesId = '';
    if(!empty($Species)){
        $SpeciesId = $Species->id;
    }

    return $SpeciesId;
}

