function SideScreen_Glazing_System($authdata,string $optionType,$UserId): string{

    $tbl1 = '';
    $aa = ScreenGlazingType::leftJoin('selected_screen_glazing', function ($join) use ($authdata): void {
        $join->on('screen_glazing_type.id', '=', 'selected_screen_glazing.glazing_id')
             ->where('selected_screen_glazing.editBy', '=', $authdata->id);
    })
    ->Join('screen_glass_type', 'screen_glazing_type.ScreenGlassId', '=', 'screen_glass_type.id')->
    wherein('screen_glazing_type.editBy', $UserId)
    ->select('screen_glazing_type.*','selected_screen_glazing.glazingSelectedPrice','selected_screen_glazing.id as selectedId','selected_screen_glazing.editBy')
    ->whereNotNull('screen_glazing_type.GlazingSystem')
    ->orderBy('screen_glazing_type.GlazingSystem', 'ASC')->get();


     // count Glazing System tbl for Glazing System according to admin or company admin
    $countOption = ScreenGlazingType::wherein('screen_glazing_type.editBy', $UserId)->count();
    // count SelecteGlazing System tbl for Glazing System according to company admin
    // $countSelectedOption = SelectedGlazingSystem::where(['userId' => $authdata->id])->count();

    if(Auth::user()->UserType == 2){
        $countSelectedOption = SelectedScreenGlazing::wherein('editBy',array_diff($UserId, ["1"]) )->groupBy('glazing_id')->count();
    }else{
        $countSelectedOption = SelectedScreenGlazing::where(['editBy' => $authdata->id])->count();
    }

    $optionCheckall = '';
    if ($countOption == $countSelectedOption) {
        $optionCheckall = 'checked';
    }

    $check = '<th>#</th>';
    $priceText = '';
    if($authdata->id != 1){
        $tbl1 .= '<button type="button" class="btn btn-success accordian_update_button" style="margin: 3px 10px 0;" onclick="updateMeOption(\'' . $optionType . '\')">Update</button>';
        $priceText = '<th>PRICE PER L/M</th>';
        $check = '<th><div class="control-group">
        <label class="control control-checkbox" style="float:left; margin-right:10px;margin-left:0px;">
            <input type="checkbox" class="checkall leaf1_glazing_systems" value="leaf1_glazing_systems" ' . $optionCheckall . '/>
            <div class="control_indicator"></div>
        </label>
    </div></th>';
    }


    $tbl1 .= '<table style="width:100%" id="example" class="table table-hover table-striped table-bordered">
                <thead class="text-uppercase table-header-bg">
                    <tr class="text-white">
                        '.$check.'
                        <th>Fire Rating</th>
                        <th>Screen Glass</th>
                        <th>Glazing System</th>
                        <th>Glazing Thickness</th>
                        <th>Beading</th>
                        <th>Beading Height</th>
                        <th>Beading Width</th>
                        <th>Fixing Details</th>
                        <th>Action</th>
                        '.$priceText.'
                    </tr>
                </thead>
                <tbody>';

                $i = 1;
                // dd($aa);
                foreach($aa as $value){
                    $screenGlass = ScreenGlassType::find($value->ScreenGlassId);
                    // $selectedOption = SelectedGlazingSystem::where([ 'glazingId' => $value->id, 'userId' => $authdata->id])->count();
