                        $selectedOption = SelectedScreenGlazing::where([ 'glazing_id' => $value->id])->wherein('editBy',array_diff($UserId, ["1"]))->count();
                    }else{
                        $selectedOption = SelectedScreenGlazing::where([ 'glazing_id' => $value->id, 'editBy' => $authdata->id])->count();
                    }

                    $select = $selectedOption > 0 ? 'checked' : '';

                    $cost = '';
                    if($authdata->id != 1 && $value->glazingSelectedPrice !== null){
                        $cost = '<div class="input-group">
                                        <input type="number" onkeyup="chooseoptioncost(this.value,' . $value->id . ',' . $value->selectedId . ",'" . $optionType . '\')" value="' . $value->glazingSelectedPrice . '" class="form-control" data-optionId="' . $value->id . '" id="' . $value->selectedId . '" data-optionName="option" pattern="[0-9]+(\\.[0-9][0-9]?)?">
                                    </div>';
