                    $action = '';
                    if (($value->EditBy != 1 || Auth::user()->UserType == 1)) {
                        $action = '
                        <div style="width:100px;">
                                <button type="button" class="btn btn-success" style="color: #fff; font-size:15px" onclick="editSideScreenGlazingSystem('.$value->id.',
                                    '.$screenGlass->id.',
                                    \''.$value->FireRating.'\',
                                    \''.$value->GlazingSystem.'\',
                                    \''.$value->FixingDetails.'\',
                                    '.$value->Beading.',
                                    '.$value->BeadingHeight.',
                                    '.$value->BeadingWidth.',
